import React, {Component} from 'react';

class Nav extends Component {
    render() {
        return (
            <div className="box">
                <h2>Navigator Component</h2>
                <div>
                    <li><a href="">Lorem.</a></li>
                    <li><a href="">Voluptatem!</a></li>
                    <li><a href="">Dicta.</a></li>
                    <li><a href="">Eum.</a></li>
                </div>
            </div>
        );
    }
}
export default Nav;
